import React from "react";
import Jayatable from "../Jayatable/Jayatable";

const JayaRank = () => {
  return (
    <div className="">
     <div className="px-4 sm:px-8 md:px-16 lg:px-32 w-full  ">
  <div className="flex mt-6 py-4 rounded-xl text-white space-y-6 flex-col justify-center bg- items-center">
    <div className="flex flex-col space-y-4">
      <h3 className="text-xl font-sans font-bold text-center">
        Login / register now become JAYA9 VIP
      </h3>
      <p className="text-center font-sans font-bold">
        Get the Benefits Now
      </p>
    </div>
    <div className=" px-5 flex flex-col sm:flex-row gap-8 sm:gap-16 justify-center sm:justify-between w-full">
      <button className="border border-white px-4 py-2 hover:border-orange-500 outline-none rounded-sm text-white w-full sm:w-auto">
        প্রবেশ করুন
      </button>
      <button className="bg-common-orange px-8 py-2 rounded-sm w-full sm:w-auto mt-4 sm:mt-0">
        নিবন্ধন
      </button>
    </div>
  </div>
</div>

      <Jayatable></Jayatable>
    </div>
  );
};

export default JayaRank;
